statuses.text:
@Maria_BlackIce "감사합니다."

천천히 그녀가 찍어준 위치로 차를 몰기 시작했다. 고맙게도. 신호가 잘 맞아떨어져 준 덕분에, 차가 멈추는 일은 거의 없었다.

"아이스크림이 녹기 전에 도착할 수 있겠네요."

@Maria_BlackIce " 뭐이리 별명이 많지. 흡혈귀가 그런 별명이 많던 종족이던가. "

하나같이 오글거려.

" 뭐, 전부 맞는 말이라 부정은 못한다는게 아이러니하지만. "

@Maria_BlackIce -
우리, 공생 좀 할까요, 그럼?
-

@Maria_BlackIce "여기서 기다려주세요."

그는 어디론가 걸음을 서둘렀다. 잠시 뒤, 세단 하나가 그녀의 앞에 멈춰선다. 이윽고, 창문이 열리며.

"그때의 멘트를 되돌려주려고 했는데, 기억이 안 나네요."

@KOIOS_Alexandra -

별말을 서로 돕게 사는거지.

-
